const Field = ({ label, value, func }) => { return (
    <div>
        <input
            placeholder={ label }
            value={ value }
            onChange={ func }
        />
    </div>
)}

const Submit = ({ label }) => { return (
    <div>
        <button>{ label }</button>
    </div>
)}

export default {
    Field,
    Submit
}
